import "./Contact.css";
export default function ContactForm() {
    return(
        <div className="contactme" id="Contact">
            <div className="contactContainer">
                <div className="description">
                <h1>Contact Me</h1>
                <br/>
                <h3>Feel free to reach out to me! My email is <a href="mailto:mibz00832@gmail.com">mibz0083@gmail.com</a></h3>
                </div>
            
            </div>
        </div>
        
    )
}
